(1, 1, '2017-08-27 15:07:32', '2017-08-27 15:07:33', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2017-08-27 15:07:32', '2017-08-27 15:07:33', '', 0, 'http://localhost/49square/?p=1', 0, 'post', '', 1),
(2, 1, '2017-08-27 15:07:32', '2017-08-27 15:07:33', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</blockquote>\n...or something like this:\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\nAs a new WordPress user, you should go to <a href=\"http://localhost/49square/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'draft', 'closed', 'open', '', 'sample-page', '', '', '2017-08-28 02:08:11', '2017-08-28 02:08:11', '', 0, 'http://localhost/49square/?page_id=2', 0, 'page', '', 0),
